import React, { useState } from 'react';

const Baji = () => {
    const tabs = ['Overview','ক্রিকেট','লাইভ ক্যাসিনো','স্লট গেম','টেবিল গেম',' স্পোর্টস','মাছ ধরা']
    const [activeTab,setActiveTab]=useState('Overview');
    return (
        <div>
            {tabs.map((tab,index)=>(
              <button  key={index}
              className={`grid grid-cols-7 ${activeTab === tab ? 'bg-common-blue':'bg-gray-200'}`}>

               {tab}
              </button>  
            ))}
        </div>
    );
};

export default Baji;
